INSERT INTO `filmy` (`IDfilmu`, `tytul`, `rok_wydania`, `czas_trwania`, `opis`, `plakat`) VALUES
(1, 'The VelociPastor', 2017, '01:15:00', 'Catholic priest Doug Jones witnesses his parents die in a car fire. He travels to China on a spiritual journey and comes across ninjas searching for an artifact said to turn people into the Dragon Warrior. After becoming infected by the artifact, Doug begins having nightmares and goes out into the forest late at night as he transforms into a dinosaur. He saves Carol, a prostitute, from a thug.\r\n\r\nWaking up in Carol\'s bed naked, with no memory of the night before, Doug initially believes they had sex, but after Carol tells him what happened he realizes the truth. Unpersuaded by her suggestion to use his new power to fight crime and get rid of people they believe are beyond spiritual salvation, he returns to the church for confessions; speaking to Frankie Mermaid, Carol\'s pimp, he learns Mermaid is the one responsible for killing Doug\'s parents.\r\n\r\nEnraged, Doug proceeds to kill Mermaid and, now convinced about her plan to fight crime, returns to Carol needing her assistance. Father Stewart, learning of Doug\'s new power, encourages Doug to lose it and stop killing. He takes him to see Altair, an exorcist, hoping to remove Doug\'s power. In a flashback, we learn Father Stewart saw a war buddy shot while off guard and that his love interest was killed in an accident. Back in the present, the exorcism fails and Doug transforms, taking one of Father Stewart\'s eyes.\r\n\r\nReturning to Carol, Doug is confronted by ninjas. Father Stewart wakes up in a camp of drug-dealing Christian ninjas, led by Wei Chan who plans to sell highly addictive cocaine to people and then cut off supplies. Wei Chan hopes this will lead the addicts to turn to the church where he will eventually take over and use them as his army. Father Stewart rejects this idea and is killed. Doug and Carol are confronted by ninjas and plan to stop Wei Chan.\r\n\r\nDoug is stopped by Sam the White Ninja, who he later realizes is his brother. Doug catches Sam off guard and uses telekinesis to take Sam\'s sword and kill him. Doug and Carol fight off more ninjas and are badly wounded. Doug, fighting off the remaining ninjas, is shot by Wei Chan with an arrow containing anti-venom to stop his transformation. Doug\'s hands are immune to the anti-venom and he proceeds to kill Wei Chan. Doug carries Carol to the hospital where she recovers.\r\n\r\nDoug, no longer a priest with a bounty on his head, plans on traveling the world with Carol and continuing their original idea of killing off criminals.', );
INSERT INTO `filmy` (`IDfilmu`, `tytul`, `rok_wydania`, `czas_trwania`, `opis`, `plakat`) VALUES
(2, 'Nie zadzieraj z fryzjerem', 2008, '01:53:00', 'Zohan Dvirr jest najskuteczniejszym agentem Mosadu. Ale bardzo chciał zostać fryzjerem. Do realizacji marzeń nie doszło, bo rodzice się nie godzili, ponieważ stał się popularny. Jego głównym wrogiem jest terrorysta zwany Duchem. Zohan podczas akcji w Palestynie pozoruje własną śmierć. Trafia do Nowego Jorku. W celu lepszego ukrycia się zmienia swój wygląd i przybiera pseudonim Scrappy Coco. Tu, nie mogąc dostać wymarzonej pracy w salonie fryzjerskim Paula Mitchella, podejmuje pracę w salonie fryzjerskim należącym do Palestynki. Mimo emigracji, nawet w USA dogoniły go skutki niezamkniętych spraw z przeszłości, którym będzie musiał stawić czoła.', );
INSERT INTO `filmy` (`IDfilmu`, `tytul`, `rok_wydania`, `czas_trwania`, `opis`, `plakat`) VALUES
(3, 'Borat: Podpatrzone w Ameryce, aby Kazachstan rósł w siłę, a ludzie żyli dostatniej', 2006, '01:22:00', 'Film jest oparty na żywiołowym popisie brytyjskiego komika Sachy Barona Cohena, w którym w formie parodii filmu dokumentalnego przedstawiono Borata Sagdijewa, dziennikarza kazachskiej państwowej telewizji, który w celu poprawy losu swojego narodu chce w Ameryce zasięgnąć wiedzy o kulturze amerykańskiej. Wyrusza on ze swej wioski w Kazachstanie do Ameryki, aby zrobić film dokumentalny o tym kraju.\r\n\r\nPodczas oglądania jednego z odcinków Słonecznego patrolu zakochuje się w grającej w nim Pameli Anderson. Zakochany Borat Sagdijew wybiera się do Kalifornii, gdzie ma nadzieję spotkać swoją ukochaną i poślubić ją.', );
INSERT INTO `filmy` (`IDfilmu`, `tytul`, `rok_wydania`, `czas_trwania`, `opis`, `plakat`) VALUES
(4, 'Kingsman: Tajne służby', 2014, '02:09:00', 'Agent służb specjalnych bierze pod swoje skrzydła nowicjusza, aby przekazać mu wiedzę zdobytą przez lata pracy.', );
INSERT INTO `filmy` (`IDfilmu`, `tytul`, `rok_wydania`, `czas_trwania`, `opis`, `plakat`) VALUES
(5, 'To', 2017, '02:15:00', 'Akcja toczy się w fikcyjnym miasteczku Derry w stanie Maine, gdzie grupa dzieci prześladowana jest przez morderczego klauna Pennywise\'a.', );
INSERT INTO `filmy` (`IDfilmu`, `tytul`, `rok_wydania`, `czas_trwania`, `opis`, `plakat`) VALUES
(6, 'Matrix', 1999, '02:16:00', 'Thomas A. Anderson (Keanu Reeves) wiedzie podwójne życie. Zawodowo pracuje jako programista komputerowy w firmie MetaCortex, natomiast w życiu prywatnym jest hakerem komputerowym o pseudonimie „Neo”. Seria niewytłumaczalnych i zaskakujących zjawisk prowadzi go do kontaktu z grupą, na czele której stoi tajemniczy Morfeusz (Laurence Fishburne), uznawany przez władze za przestępcę i terrorystę. Wyjaśnia on Neo, czym jest Matrix, po czym oferuje pokazanie prawdziwego, niezakłamanego świata. Tam Neo na własne oczy przekonuje się, że żyje w postapokaliptycznym świecie. Ludzie wymyślili sztuczną inteligencję (SI), jednakże maszyny wyrwały się spod ich kontroli i zwróciły się przeciwko twórcom. Aby odciąć je od energii słonecznej, ludzie spowili niebo czarnym smogiem. Decyzja ta okazała się fatalna w skutkach – maszyny jako źródło energii wybrały ludzi, więżąc ich w programie zwanym Matriksem, symulującym świat z roku 1999. Istnieje jednak grupa ludzi niepodłączonych. Wśród nich jest między innymi załoga statku Nabuchodonozor, której kapitanem jest Morfeusz.\r\n\r\nMorfeusz uwalnia Neo z Matriksa, wierząc, że jest on Wybrańcem, przepowiedzianym przez Wyrocznię wybawicielem i człowiekiem, który zakończy wojnę i przyniesie pokój. Sam Neo jest raczej sceptyczny wobec swoich umiejętności – pod okiem Morfeusza stopniowo uczy się jednak naginać i łamać reguły systemu komputerowego.\r\n\r\nDla maszyn ludzie wyzwoleni, nieprzynoszący energii, a jedynie uwalniający innych, są szkodnikami. Istnieje specjalna grupa programów, zwanych agentami. Na ich czele stoi agent Smith. Są oni strażnikami Matriksa, ścigają i zabijają osoby, których wirtualne ego wysyłane jest za pomocą pirackiego sygnału. Agenci odznaczają się nadnaturalną siłą i szybkością, są zdolni do unikania pocisków i przejmowania ciała dowolnego człowieka żyjącego w Matriksie. Są nieśmiertelni, lecz zasady ich bytu i zachowań zostały ograniczone regułami programu komputerowego. Wybraniec mógłby je jednak złamać i pokonać agentów.\r\n\r\nNeo spotyka się z Wyrocznią, która wskazuje mu jego ścieżkę. Będzie on musiał podjąć decyzję – wybór pomiędzy zachowaniem swojego życia a uratowaniem Morfeusza. Wyrocznia sugeruje, że Neo wybrańcem nie jest, przynajmniej jeszcze nie. Wkrótce potem Cypher, jeden z członków załogi Nabuchodonozora, preferujący ignorancję zamiast prawdy, zdradza Morfeusza, którego pojmują agenci. Chcą wydobyć z niego kod dostępu do Syjonu – jedynego miasta ludzi, do którego maszyny nie mają dostępu. Neo dokonuje wyboru przepowiedzianego przez wyrocznię – wyrusza wraz z Trinity na ratunek Morfeuszowi. Udaje się go uwolnić i bezpiecznie doprowadzić do wyjścia z Matriksa. Na przeszkodzie po raz kolejny staje jednak agent Smith – po ucieczce Trinity przestrzeliwuje kabel, pozwalający na bezpieczne przejście do prawdziwego świata. Neo podejmuje walkę z agentem, który ginie w obecnym ciele pod kołami pociągu. Wkrótce pojawia się w nowym wcieleniu, zmuszając Neo do ucieczki.\r\n\r\nW tym samym czasie w prawdziwym świecie maszyny przeprowadzają atak na statek Morfeusza. Nie może on odpalić ładunków niszczących układy elektroniczne w sytuacji, gdy Neo jest podłączony do Matriksa. Sytuację komplikuje fakt, że niedoszły Wybraniec zostaje postrzelony i zabity przez agenta. Trinity nie może pogodzić się ze śmiercią ukochanego – jej pocałunek w prawdziwym świecie przywraca go do życia w Matriksie. Zmartwychwstały Neo doznaje olśnienia, staje się wybrańcem. Zatrzymuje lecące w jego stronę kule, a następnie niszczy agenta Smitha. Po powrocie Neo do prawdziwego świata Morfeusz odpala ładunki elektromagnetyczne niszczące maszyny oraz elektroniczne układy Nabuchodonozora.\r\n\r\nWkrótce potem Neo powraca do Matriksa – grozi maszynom, że zrobi wszystko, by otworzyć ludziom oczy i wyzwolić spod panowania robotów.', );
INSERT INTO `filmy` (`IDfilmu`, `tytul`, `rok_wydania`, `czas_trwania`, `opis`, `plakat`) VALUES
(7, 'Warcraft: Początek', 2016, '02:03:00', 'Kraina Azeroth staje w obliczu konfliktu, kiedy najeżdżają ją istoty z innego świata: orkowie, poszukujący nowego domu, kiedy ich własny ginie. Gdy orkowie przechodzą przez portal do innego świata, kolonizują go w całości dla siebie i niszczą pozostałe rasy. Po przeciwnej stronie znajdują się ludzie, którzy muszą walczyć o swoje życie, rodziny i los całej krainy.', );
INSERT INTO `filmy` (`IDfilmu`, `tytul`, `rok_wydania`, `czas_trwania`, `opis`, `plakat`) VALUES
(8, 'Zielona mila', 2000, '01:21:00', 'Zielona mila jest historią opowiedzianą przez wiekowego Paula Edgecomba (Dabbs Greer) w domu spokojnej starości. Po obejrzeniu filmu pt. Top Hat przypomina sobie pewne zdarzenia i opowiada swojej przyjaciółce, Elaine Connely (Eve Brent), o niezwykłym więźniu, którego spotkał w lecie 1935 roku, gdy pracował jako strażnik więźniów skazanych na karę śmierci w więzieniu w Luizjanie. Blok, na którym pracował, nazywany był zieloną milą ze względu na kolor linoleum leżącego na podłodze. Niemym bohaterem celi śmierci jest również krzesło elektryczne (zwane Starą Iskrówą, ang. Old Sparky), oczekujące na swoje ofiary.\r\n\r\nPewnego dnia na oddział trafia olbrzymi, czarnoskóry John Coffey (Michael Clarke Duncan), oskarżony o zamordowanie dwóch białych dziewczynek. Coffey okazuje się łagodnym olbrzymem, bojącym się ciemności i czasami płaczącym. Niedługo ujawnia swe niezwykłe zdolności uzdrawiające przez wyleczenie Paula Edgecomba (Tom Hanks) z zapalenia pęcherza moczowego oraz ożywienie myszy.\r\n\r\nPercy Wetmore (Doug Hutchison) jest wrednym, sadystycznym strażnikiem lubiącym sprawiać cierpienie innym. Ma również wysoko postawionego wujka (jest bratankiem żony gubernatora stanu), który „załatwił” mu tę pracę i nie bardzo można pozbyć się go z obecnego stanowiska. Za pozwolenie wykonania wyroku obiecuje przenieść się na inne miejsce. Podczas wykonania wyroku Percy umyślnie nie moczy gąbki, umożliwiającej lepszy przepływ prądu, by zobaczyć efekty. Skazany więzień, Eduard Delacroix (Michael Jeter), umiera przez dość długi czas w strasznych męczarniach, a także zapala się, co wywołuje panikę wśród świadków.\r\n\r\nStrażnicy wykorzystują zdolności uzdrawiające Johna, by wyleczyć żonę naczelnika więzienia. Po powrocie do więzienia John przenosi jej chorobę na Percy’ego Wetmore’a, by go ukarać za to, co zrobił z Eduardem Delacroix. Pod wpływem Coffeya kompletnie oderwany od rzeczywistości Percy zabija jednego z więźniów – Dzikiego Billa (Sam Rockwell), a następnie zostaje umieszczony w zakładzie dla obłąkanych. Paul utwierdza się w przekonaniu, że John jest niewinny, a proces był czysto formalny (znaleziono go tulącego do siebie martwe dziewczynki – czarny musi być winny, choć w rzeczywistości wcale ich nie zabił, tylko znalazł i próbował pomóc za pomocą swoich zdolności, prawdziwym mordercą był Dziki Bill), ale nie ma na to dowodów. Egzekucja musi się odbyć. Przed śmiercią John ogląda ten sam film, który oglądał Paul na początku filmu. Była to ostatnia egzekucja, w której uczestniczyli Paul i Brutus, po tym zdarzeniu przenieśli się do pracy w domu poprawczym.', );
INSERT INTO `filmy` (`IDfilmu`, `tytul`, `rok_wydania`, `czas_trwania`, `opis`, `plakat`) VALUES
(9, 'Indiana Jones i ostatnia krucjata', 1989, '02:07:00', 'Film rozpoczyna się w 1912 roku, gdy Indiana Jones ma ok. 15 lat i jest skautem. Szuka krzyża Coronado w Utah. Chce oddać znaleziony skarb do muzeum, ale ścigają go inni poszukiwacze. Indy ucieka przed nimi przez pociąg, który przewozi zwierzęta (ma bliskie spotkania z nosorożcem i… wężami), ale ostatecznie udaje mu się uciec do domu, w którym spotyka swojego ojca. Wtedy wchodzą do domu jego rywale przebrani za pracowników muzeum i odbierają od niego krzyż. Jednak upór i siła Indy’ego wzbudza podziw ich szefa (który podejrzanie przypomina dorosłego Indy’ego) i dlatego w nagrodę oddaje mu swój kapelusz…\r\n\r\nW 1938 roku Indiana Jones otrzymuje propozycję uczestniczenia w wyprawie zorganizowanej w celu znalezienia św. Graala. Początkowo nie chce brać udziału w poszukiwaniu chrześcijańskiej relikwii. Zmienia zdanie, gdy dowiaduje się, że jeden z członków ekspedycji już zaginął i że jest nim jego ojciec, Henry Jones (Sean Connery). Choć ojciec i syn nie widzieli się od lat, Indiana decyduje się jechać do Wenecji, gdzie znajduje się grobowiec średniowiecznego rycerza, który dotarł do cudownego kielicha. Towarzyszy mu Marcus Brody. Napotyka austriacką Doktor Elsę Schneider, która na zlecenie nazistów ma przechwycić Graala. Mami Indy’ego propozycją współpracy.\r\n\r\nWkrótce wszyscy troje przeszukują grobowiec. Atakują ich tajemnicze indywidua, które porywają Brody\'ego i ścigają Elsę i Jonesa na rzece. Po pościgu jeden z nich – Kazim – mówi Jonesowi, by nie szukał Graala. Jones i Elsa wyruszają jednak do Austrii, gdzie spotykają ojca Indy’ego i nazistów pod wodzą historyka Waltera Donovana i generała Vogela. Wtedy też wychodzi na jaw, że Elsa jest ich wspólniczką. Podpaleniu ulega dom, skąd udaje się im wkrótce uwolnić.\r\n\r\nPo widowiskowej uciecze przed Austriakami docierają do Niemiec, gdzie odnajdują dziennik, w którym zaznaczone jest miejsce spoczynku Graala. Indy spotyka też Adolfa Hitlera i przypadkowo dostaje od niego autograf. Później usiłuje wraz z ojcem uciec niemieckim Zeppelinem, ten jednak zawraca z powrotem do Niemiec. Po walce z nazistami Jonesom udaje się o własnych siłach wydostać z terenu III Rzeszy.\r\n\r\nTymczasem Brody zostaje porwany przez hitlerowców. Docierają do państwa Hatay. W ślad za nimi docierają Jonesowie i ich stary przyjaciel – Sallah. Atakują nazistów (przedtem Donovan i Elsa oddalili się na chwilę od Vogela i jego żołnierzy oraz Brody\'ego). Rozpoczyna się strzelanina, w której udział biorą naziści i ludzie Kazima, który zostaje postrzelony kilkanaście razy, w wyniku czego umiera. Chwilę później ma miejsce widowiskowa walka w czołgu między Vogelem i jego ludźmi a czwórką głównych bohaterów. Ostatecznie czołg wraz z Vogelem i Indianą spada w przepaść. Vogel ginie, Indy\'emu udaje się cudem przeżyć.\r\n\r\nJonesowie, Sallah i Brody docierają do starej budowli, w której spoczywa Graal. Są tam już Elsa i Donovan oraz ocalali naziści. By dotrzeć do Graala, śmiałek musi przejść trzy niezwykle trudne próby – test na wierność Bogu. Donovan śmiertelnie rani ojca Indiany – tylko Graal może go uzdrowić, a Indy nie ma wyjścia – musi znaleźć Graala. Udaje mu się ominąć ruchome brzytwy, wystukać imię Jehowa (zwracając uwagę na łacińską pisownię) na kamiennych płytkach i przejść po niewidzialnym moście. W ślad za nim podążają Donovan i Elsa. Docierają do starej krypty. Spotykają tam starego rycerza i kilkadziesiąt kielichów, jeden z nich to Graal. Donovan bierze fałszywy i w ciągu kilku sekund zaczyna się gwałtownie starzeć i w końcu obraca się w proch. Jones wybiera prawdziwy kielich. Nieśmiertelność zyska jednak jedynie wtedy, gdy nie wyniesie Graala z krypty – musi jednak ratować ojca, co udaje mu się. Jednak przez swoją chciwość Elsa łamie zakaz rycerza i spada w przepaść, a wraz z nią Graal.\r\n\r\nGdy Brody, Sallah i Jonesowie wychodzą z krypty, Henry Jones mówi Sallahowi i Brody\'emu, ku wielkiej uciesze Sallaha, że Indy naprawdę nazywa się Henry Jones Junior, a przydomek Indiana ma po psie.', );

